import { StyleSheet } from "react-native";

const StyleQuestionsPage = StyleSheet.create({
    conteiner:{
        flex:1,
        backgroundColor:'#E3C07C'
    },

    textConteinre:{
        marginLeft:"3%",
        marginTop:"5%",
    }
});

export default StyleQuestionsPage;
